                    <p align="left" class="12wh style2">Bali hat erheblich mehr zu bieten als die meisten Reisef&uuml;hrer aufzeigen. Die malerische Sch&ouml;nheit der vulkanischen Insel mit ihrer tropischen Vegetation und ihrer reichen Tier und Pflanzenwelt, die beeindruckende Gestaltung der  typischen Bali-Style H&auml;user und alten Tempel, sch&ouml;ne Straende die Surfer aus aller Welt anlocken und der Charme und die Freundlichkeit der Balinesen, ist beinahe zuviel des Guten f&uuml;r einen normalen Durchschnittstouristen. Aber es gibt noch eine anspruchsvollere Spezies von Urlaubern - den Entdecker und Taucher, der neben  hervorragenden Tauchabenteuern, die Freude und Pracht eines abgelegenen, komfortablen und gut organisierten Resort braucht - fernab vom Massentourismus.  </p>
