                    <p align="left"><span class="style2">Dies ist der Hauptgrund warum wir das Tauch Resort Tulamben so engagiert und professionell aufgebaut haben. Inmitten von <span class="12wh style2">&uuml;</span>ppiger exotischer Vegetation und Palmen, haben wir komfortable Unterk<span class="12wh style2">&uuml;</span>nfte und stilvolle Zimmer f<span class="12wh style2">&uuml;</span>r sie bereit. <br>
                      Ein gro<span class="12wh style2">&szlig;</span>er, 3 Meter tiefer Pool l<span class="12wh style2">&auml;</span>dt sie zu einer entspannten Pause zwischen den Tauchg<span class="12wh style2">&auml;</span>ngen ein. Das direkt am Strand gelegene Resort macht das Tauchen dort zu einem puren Vergn<span class="12wh style2">&uuml;</span>gen, denn wir bieten ein aufregendes Schiffswrack aus dem 2ten Welkrieg, eine Steilwand und einen farbenpr<span class="12wh style2">&auml;</span>chtigen Korallengarten - alles direkt vor unserer &quot;Haust<span class="12wh style2">&uuml;</span>re&quot;! Unser Restaurant bietet ihnen ein reichhaltiges Angebot an internationaler und lokaler K<span class="12wh style2">&uuml;</span>che. Checken sie ein, entspannen und genie<span class="12wh style2">&szlig;</span>en sie unser einmaliges Tauch Terminal Resort Tulamben. </span></p></td>
